//Importing all the required packages

const mongoose = require('mongoose'); // Importing mongoose for connecting to mongoDB
const { Schema } = mongoose; // Importing the schema feature of the mongoose to declare the scheme of the user data storage
const dotenv = require('dotenv');
dotenv.config()
const d = new Date()

const ProductsSchema = new Schema({
    _title: {
        type: String,
        required: true,
        min: 3
    },
    _description: {
        type: String,
        required: true,
        min: 3
    },
    _price: {
        type: String,
        required: true,
        min: 3
    },
    _category: {
        type: String,
        default: "incenses"
    },
    _image: {
        type: String,
        default: ""
    },
    _date: {
        type: String,
        default: (d.getDay()) + "-" + (d.getMonth() + 1) + "-" + d.getFullYear()
    },
    _reviews: {
        type: String,
        default: ""
    },
    _stock: {
        type: Number,
        default: 0
    },
    _salePrice: {
        type: String,
        required: true,
        min: 3
    },
    _modelNumber: {
        type: String,
        required: true,
        min: 3
    },
    _vendor: {
        type: String,
        default: "NCT Edge"
    },
    _onSale: {
        type: Boolean,
        default: false
    },
    _brand: {
        type: String,
        default: "NCT"
    },
    _published: {
        type: Boolean,
        default: false
    },
    _featured: {
        type: Boolean,
        default: false
    },
    _latest: {
        type: Boolean,
        default: false
    }
}, {
    timestamps: true
})

ProductsSchema.index({
    _title: 'text'
})

// Converting the UserSchema to a model

const Products = mongoose.model('products', ProductsSchema); //Compliling the UserSchema to commerceFox registered users model


// Exporting the model to be used by other modules

module.exports = Products; //exporting the model Users

// Instant Chat MongoDB model codebase completed